import React from 'react';
import BottomBar from '../components/navbar/BottomBar';
import img from '/home/geekcoderr/Astra/Projects/TRAVELBACKUP/src/assets/images/garrett-parker-DlkF4-dbCOU-unsplash.jpg';
// import MapSection from '../components/MapSection';
// import BusBookingForm from '../components/BusBookingForm';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="hero-section">
        <div className="hero-content">
          <h1>Experience the Best Bus Booking with Fatafat Yatra</h1>
          <p>
            Discover the top reasons why Fatafat Yatra is the go-to platform for
            all your bus travel needs.
          </p>
          <ul>
            <li>
              <div className="glass-effect">
                <i className="fas fa-lightning"></i>
                <div>
                  <h3>Lightning-Fast Booking</h3>
                  <p>
                    Book your bus tickets in a matter of seconds with our
                    user-friendly interface.
                  </p>
                </div>
              </div>
            </li>
            {/* Additional feature points */}
          </ul>
        </div>
        <div className="hero-image">
          <img src={img} alt="Fatafat Yatra" />
        </div>
      </div>

      <div className="animated-text-section">
        <h2>
          <span className="typing-effect">
            Discover the easiest way to book your bus tickets.
          </span>
        </h2>
      </div>

      <MapSection />

      <BusBookingForm />

      <BottomBar />
    </div>
  );
};

export default LandingPage;
